import Login from './learningPages/Login.js';
import './CSS/Login.css'
function App() {
  return (
    <>
    <div className='split left'>
      <div className='middle'>
        <h1>Welcome</h1>
      </div>
    </div>
    <div className='split right'>
      <Login/>
    </div>
    </>
  );
}

export default App;
